import React from "react";

import { updatePost } from "../lib/firebase-api";

const AddPost = () => {
  const postId = "NbUVI1AB8Z75VYLHdR3C";

  const postObj = {
    content: "wanna looking for a react job!",
    email: "tranzuo@gmail.com",
    modifieddate: "2022/09/06",
    title: "Learning React!!!",
    username: "Zuo Chen",
  };

  updatePost(postId, postObj);

  return (
    <React.Fragment>
      <div>AddPost</div>
    </React.Fragment>
  );
};

export default AddPost;
